import React from 'react'
 
const Categories = ({ category, image }) => {

  return (
    
        <div style={{ padding: '0 0px' }}>
            <div className="categories" style={{ width: 150, height: 200, background: '#EEE' }}>
              <img src={image} alt="" />
              <p>{category}</p>
            </div>
        </div>
    
  );
};

export default Categories
